const App = () => {
  return (
    <Router>
    <div>
      <Header />
      <Routes>
        <Route path="/" element={<HomeComponent />} />
        <Route path="/about" element={<About />} />
        <Route path="/login" element={<AuthForm/>} />
      </Routes>
    </div>
  </Router>
  );
}

export default App;
